    display: flex;
    width: 100%;    
    justify-content: space-evenly;
`

const CoffeeImage = styled.img`
    width: 50px;
    height: 50px;
`
const SteakImage = styled.img`
    width: 50px;
    height: 50px;
`
const DessertImage = styled.img`
    width: 50px;
    height: 50px;
`


const Categories = ({categories}) =>{

    return(
        <CategoriesContainer>
            <CoffeeImage src={categories[0].img}/>
            <CoffeeImage src={categories[0].img}/>
            <CoffeeImage src={categories[0].img}/>
            <CoffeeImage src={categories[0].img}/>
            <CoffeeImage src={categories[0].img}/>
            <SteakImage src={categories[0].img}/>
            <DessertImage src={categories[0].img}/>
        </CategoriesContainer>
    )
}

export default Categories;
